    currentPassword: "",
    newPassord: "",
    reapeatPassword: ""
  };

  render() {
    return (
      <div>
        <h1>ProfilePage</h1>
        <label htmlFor='fullName'>Full Name:</label>
        {/* { this.state.showError && this.state.formsError.fullName } */}
        <input
          id='fullName'
          placeholder='Full Name'
          name='fullName'
          type='text'
          // value={ this.state.fullName }
          // onChange={ this.handleChange }
        />

        <hr />
        <InputText name='TestName' />
      </div>
    );
  }
}

